import './feed.css';

import Post from '../post/Post';

export default function Feed() {
    return (
        <div className='feed'>
            <div className="feed-wrapper">
                <Post/>
                <Post/>
                <Post/>
                <Post/>
            </div>
        </div>
    )
}
